import './Contact.css';

function Contact() {
    return (
      <div>
        <h1>GET IN TOUCH</h1>
        <h2 size="md-6">Have a question for us?</h2>
        <p>Ask away! We’d also love to hear your suggestions on new categories you’d like to see. </p>
      </div>
    );
  }

  export default Contact
